import { useState } from "react";
import Button from "../components/Button/Button";

const Home = () => { 

    const [count, setCount] = useState(0)

    const add = ()=> {
        setCount( count + 1)
    }

    return (
        <Button onClick={add}>
            <div>{ count }</div>
        </Button>
    )
}

export default Home;
